import React, { Component } from 'react'
import '../css/call.css'
import CallControls from './CallControls'
import rateCallImage from '../images/rate_call.svg'

class CallPage extends Component {
	constructor(props) {
		super(props)

		this.state = {
			onCall:true
		}
		this.setCallState = this.setCallState.bind(this)
		this.onCallPage = this.onCallPage.bind(this)
	}
	setCallState = (newState) => {
		this.setState({
			onCall:newState
		})
	}
	componentDidMount(){
		console.log(this.props.match);
	}
	onCallPage = () => {
		return (
			<div>
				<div className="video__element">
				</div>
				<CallControls hangup={this.setCallState} />
			</div>
		)
	}
	rateCallPage = () => {
		return (
			<div>
				<img  src={ rateCallImage } />
			</div>
		)
	}
	render() {
		return (
			<div>
				{
					this.state.onCall ? this.onCallPage() : this.rateCallPage()
				}
			</div>
		)
	}
}

export default CallPage
